import { connect } from 'react-redux';

class Dashboard extends Component {
  render() {
    return (
      <div>
        <p>{ email }</p>
        <p>{ password }</p>
      </div>
    )
  }
}

const mapStateToProps = (state) => ({
  email: state.user.email,
  password: state.user.password,
});

export default connect (mapStateToProps)(Dashboard);
